Huge thanks to @lukeaikins / 
@redbullairforce for setting up such a memorable day for Addy and I. Nothing beats seeing a genuine smile on your kids face. @rhianongelsomino got her first skydive with Luke and i got to tag along. Didn’t film the riding because we were too busy having fun but Luke, Andy and the rest of the Aikens crew have it figure out!
@redbull @nitrocircus @lynzskate @chexmachine @monicaaikins @traxxas #familyfun @kizik

Huge thanks to @subarumotorsportsusa for giving @rhianongelsomino and I the tools to win and the safety to walk away without injury when it went wrong. Epic fight all weekend against the most stacked field I've ever seen in American Rally. Extremely disappointed in myself for making such a big error while leading with only 5 miles to go. Happy we were able to maintain the points lead and stoked for my Subaru teammate @brandonsemenuk who moved into second. I will learn from this and we will be back.
Thanks to all the rally fans who came out to support us! 
@yokohamatire @kuhl @redbull @redbullmotorsports @alpinestars @bellhelmets @nitrocircus @motul @kmcwheels
